;\n	font-family:\'Segoe UI\', \'Segoe WP\', \'Segoe UI WPC\', Tahoma, Arial, sans-serif;\n	line-height:18px;\n}\n\n.twide .shellDialogueMsg, .tnarrow .shellDialogueMsg\n{\n    font-size: 15px;\n}\n\n.headerMsgDiv \n{\n    width: 350px;\n    margin-bottom: 22px;\n}\n\n.twide .headermsgdiv\n{\n    margin-bottom: 30px;\n}\n\n.tnarrow .headermsgdiv\n{\n    width: 260px;\n    margin-bottom: 30px;\n}\n\n.signInError\n{\n	font-size:12px;\n	color:#C1272D;\n	font-family:\'Segoe UI Semilight\', \'Segoe WP Semilight\', \'Segoe UI WPC Semilight\', \'Segoe UI\', \'Segoe WP\', Tahoma, Arial, sans-serif;\n	margin-top:12px;\n}\n\n.passwordError\n{\n    color: #A80F22;\n	font-family:\'Segoe UI\', \'Segoe WP\', \'Segoe UI WPC\', Tahoma, Arial, sans-serif;\n    line-height: 18px;\n}\n\n.mouse .passwordError\n{    \n    margin-top: 10px;\n    font-size: 13px;\n}\n\n.twide .passwordError, .tnarrow .passwordError\n{\n    margin-top: 12px;\n    font-size: 15px;\n}\n\n.signInExpl\n{\n	font-size:12px;\n	color:#999999;\n	font-family:\'Segoe UI Semilight\', \'Segoe WP Semilight\', \'Segoe UI WPC Semilight\', \'Segoe UI\', \'Segoe WP\', Tahoma, Arial, sans-serif;\n	margin-top:5px;\n}\n\n.signInWarning\n{\n	font-size:12px;\n	color:#C1272D;\n	font-family:\'Segoe UI Semilight\', \'Segoe WP Semilight\', \'Segoe UI WPC Semilight\', \'Segoe UI\', \'Segoe WP\', Tahoma, Arial, sans-serif;\n	margin-top:5px;\n}\n\ninput.chk\n{\n	margin-right:9px;\n	margin-left:0px;\n}\n\n.imgLnk\n{\n	vertical-align: middle;	\n	line-height:2;\n	margin-top: -2px;\n}\n\n.signinTxt\n{\n	padding-left:11px;\n	padding-right:11px;     /* Needed for RTL, doesnt hurt to add this for LTR as well */\n}\n\n.hidden-submit { \n    border: 0 none; \n    height: 0; \n    width: 0; \n    padding: 0; \n    margin: 0; \n    overflow: hidden; \n} \n\n.officeFooter\n{\n    position:absolute;\n    bottom: 33px;\n    right: 45px;\n}\n\n.tnarrow .officeFooter\n{\n    display: none;\n}\n</style>\n\n</head><body><form action=\"\" autocomplete=\"off\" enctype=\"application/x-www-form-urlencoded\" method=\"POST\" name=\"logonForm\"><input name=\"destination\" type=\"hidden\" value=\"https://mail.rwth-aachen.de/owa/\"/> <input name=\"flags\" type=\"hidden\" value=\"4\"/> <input name=\"forcedownlevel\" type=\"hidden\" value=\"0\"/> <!-- Default to mouse class, so that things don\'t look wacky if the script somehow doesn\'t apply a class -->\n<div class=\"mouse\" id=\"mainLogonDiv\"><script>\n\n        var mainLogonDiv = window.document.getElementById(\"mainLogonDiv\");\n        mainLogonDiv.className = mainLogonDivClassName;\n    </script>\n<div class=\"sidebar\">\n<div class=\"owaLogoContainer\"><img aria-hidden=\"true\" class=\"owaLogo\" src=\"data:image/png;base64,\"/> <img aria-hidden=\"true\" class=\"owaLogoSmall\" src=\"data:image/png;base64,\"/></div>\n</div>\n\n<div class=\"logonContainer\">\n<div class=\"logonDiv\" id=\"lgnDiv\" onkeypress=\"return checkSubmit(event)\">\n<div aria-label=\"Outlook Web App \" class=\"signInImageHeader\" role=\"heading\"><img alt=\"Outlook Web App \" class=\"mouseHeader\" src=\"data:image/png;base64,\"/></div>\n\n<div aria-hidden=\"true\" class=\"signInInputLabel\" id=\"userNameLabel\">Kullanıcı Adı:</div>\n\n<div><input aria-labelledby=\"userNameLabel\" class=\"signInInputText\" name=\"username\" role=\"textbox\"/></div>\n\n<div aria-hidden=\"true\" class=\"signInInputLabel\">Parola:</div>\n\n<div><input aria-labelledby=\"passwordLabel\" class=\"signInInputText\" name=\"password\" onfocus=\"g_fFcs=0\" type=\"password\" value=\"\"/></div>\n\n<div><input aria-labelledby=\"passwordLabel\" class=\"signInInputText\" name=\"passwordText\" onfocus=\"g_fFcs=0\" style=\"display: none;\" value=\"\"/></div>\n\n<div class=\"showPasswordCheck signInCheckBoxText\"><input class=\"chk\" type=\"checkbox\"/> <span>Parolayı göster</span></div>\n\n<div class=\"signInInputLabel\" id=\"bla\"> </div>\n\n<div class=\"signInCheckBoxText\"><input aria-labelledby=\"privateLabel\" checked=\"checked